import React from 'react'
import './App.css';

function App() {

  return(
    <div className="container"> 
  <h1> PhotoGallery</h1>
  <ul>
    <li>
      <button>
        <span role="img" aria-label="grinning face" id= "grinning face"></span>
      </button>
    </li>
  </ul>
  </div>
  )
}
// the <> creates a single elemnt, but when the code is compild it is not added to the final markup.
export default App;
